import './ExpenseItem.css';

function ExpenseItem() {
    return (
        <div>
            <h2>Expense Items</h2>
            <p>Food Rs.10</p>
            <p>Petrol Rs.100</p>
            <p>Movies Rs.200</p>
        </div>
    )
}

export default ExpenseItem;
